var tipuesearch = {"pages": [{'title': 'About', 'text': 'This is  https://github.com/mdecourse/cmstemplate \n 目前的 cmsimde 在編輯器下方新增一個 csave 按鈕, 意即 collabrative save, 當動態網際管理系統在多人同時維護登入維護網頁內容時, 編輯各頁面時段, 該頁面可能已經改版, 因此使用 csave 按鈕存檔時, 會導入當下最新的該頁面內容, 並試圖與編輯中的頁面內容進行合併. \n 使用 csave 按鈕存檔無法刪除頁面資料. \n 使用 Edit All 模式, 無法使用 csave 按鈕（尚未測試). \n', 'tags': '', 'url': 'About.html'}, {'title': 'W1 W2', 'text': '建立WCM2021的倉儲 \n \n', 'tags': '', 'url': 'W1 W2.html'}, {'title': 'W3', 'text': '到 mde tw 的 cmstemplate 的網站中 \n 即可了解到建立倉儲中常見的問題 \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '學校的課程相關主機為\xa0 https://qry.nfu.edu.tw/ \n 查詢各班課表用\xa0 https://qry.nfu.edu.tw/class.php \n 再使用spring v2 ipv6 去拉出四設計一甲班及課表 \n \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W5', 'text': '學習如何設定用ssh對github連線 \n 雖然在大一上學期的cp2020中已經講解過ssh(如下面的網址) \n http://mde.tw/cp2020/content/SSH.html \n 也說過如何設置ssh對github連線， 不過因不熟悉如何操作，所以在本周重新再設定一次( 如下面的網址 ) \n http://mde.tw/cd2021/content/SSH%20%E4%BA%86%E6%B2%92.html \n 下列為老師所拍攝的教學影片 \n \n \n \n 4/1 在heroku上創建一個帳號，去a.kmol.info.88，下載heroku.7z至隨身系統中，如下面網址操作 \n http://mde.tw/lab/content/Heroku.html \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W8', 'text': '開始製作分組專題 \n 先了解Topic0  http://mde.tw/wcm2021/content/Topic%200.html \xa0中怎麼從學校教務主機拉出我們班四設計一甲的課表 \n 也拉出實驗室排時間的課表\xa0 http://mde.tw/wcm2021/content/W7.html \xa0如此網址所述。 \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '期中分組報告 \n', 'tags': '', 'url': 'W9.html'}, {'title': 'W10', 'text': '設定ssh\xa0 \n', 'tags': '', 'url': 'W10.html'}, {'title': 'W11 W12', 'text': '下載robodk這個程式 \n', 'tags': '', 'url': 'W11 W12.html'}, {'title': 'W13', 'text': '開始遠距上課 \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14', 'text': '試著操作robodk這個程式 \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W15', 'text': '小組錄製討論畫面 \n 並放到分組網站上 \n \n', 'tags': '', 'url': 'W15.html'}]};